import React from 'react';

function RightCard(props){
    return(
        <div className={props ? `card ${props.cal.className}`:`card`} >
                <img class="card-img-top" src={props.urlToImage} alt="Card image cap" />
                <div class="card-body">
                    <h5 class="card-title">{props.title}</h5>
                    <p class="card-text">{props.content}</p>
                </div>
            </div>
    )
}
export default RightCard;
